# Question: 003-Longest-Substring-Without-Repeating-Characters
# Link:     https://leetcode.com/problems/longest-substring-without-repeating-characters/
# ==============================================================================
# Given a string, find the length of the longest substring without repeating 
# characters. For example, the longest substring without repeating letters for 
# "abcabcbb" is "abc", which the length is 3. For "bbbbb" the longest substring 
# is "b", with the length of 1.
# ==============================================================================
# Method: Traverse; Hash Table; Two pointers
# Time Complexity: O(n)
# Space Complexity: O(1)
# Note: "s[end] not in s[start:end]" is of O(1) time complexity in python ?
# ==============================================================================

class Solution:
    # @param {string} s
    # @return {integer}
    def lengthOfLongestSubstring(self, s):
        if not s:
            return 0

        maxVal = 1
        start = 0
        end = 1
        size = len(s)

        while True:
            while end < size and s[end] not in s[start:end]:
                end += 1
            maxVal = max(maxVal, end-start)

            if start >= size or end >= size:
                break

            start = start + s[start:end].index(s[end]) + 1
            end += 1

        return maxVal

